var title_f8_21_8531="SEER incidence of thyroid cancer by race and sex";
var content_f8_21_8531=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F58551&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F58551&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 699px\">",
"   <div class=\"ttl\">",
"    SEER observed incidence, SEER delay adjusted incidence and US death rates*, cancer of the thyroid, by race and sex",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 679px; height: 457px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Source: SEER 9 areas and US Mortality Files (National Center for Health Statistics, CDC).",
"     <br/>",
"     Rates are age-adjusted to the 2000 US Std Population (19 age groups - Census P25-1103).",
"     <br/>",
"     Regression lines and APCs are calculated using the Joinpoint Regression Program Version 3.5, April 2011, National Cancer Institute.",
"     <br/>",
"     The APC is the Annual Percent Change for the regression line segments. The APC shown on the graph is for the most recent trend.",
"     <br/>",
"     &Delta; The APC is significantly different from zero (p&lt;0.05).",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Howlader N, Noone AM, Krapcho M, et al (Eds). SEER Cancer Statistics Review, 1975-2008, National Cancer Institute. Bethesda, MD. Full report available at:",
"     <a href=\"file://seer.cancer.gov/csr/1975_2008/\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"      file://seer.cancer.gov/csr/1975_2008/",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
