var title_f8_21_8532="M mode aorta hypertrophic CM";
var content_f8_21_8532=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F75078&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F75078&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    M-mode echocardiogram in hypertrophic cardiomyopathy with dynamic obstruction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 386px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In hypertrophic cardiomyopathy there is altered diastolic function, with slow left ventricle relaxation and left atrial (LA) emptying; the aortic (Ao) root diastolic motion is altered so that early rapid posterior motion is not seen until atrial contraction. This pattern is the counterpart of the a-wave dominant diastolic pattern seen by Doppler. The net forward motion of the Ao is adequate, but the timing and distribution have changed. The initial opening of the aortic valve (AV) is normal but shows a prominent midsystolic closure or notch, which coincides with the onset of subaortic obstruction induced by the systolic contact of the mitral valve with the septum; the AV often reopens for the second half of systole.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
