var title_f8_21_8535="Haley-Haley histology";
var content_f8_21_8535=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F75555&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F75555&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Histopathologic findings in Hailey-Hailey disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Skin biopsy from the axilla of a 58-year-old woman who complained of a chronic erosive irritated intertriginous eruption for years. The histologic examination reveals suprabasilar clefting of the epidermis; full thickness acantholysis with some dyskeratosis near the granular layer; and sparse perivascular lymphocytic infiltrate in the papillary dermis with scattered eosinophils. These findings are typical of Hailey-Hailey disease. Direct immunoflourescence was negative.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Nathan Jones, MSIV, Dermatlas;",
"     <a href=\"file://www.dermatlas.org\" target=\"_blank\">",
"      file://www.dermatlas.org",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
