"    This device consists of a T-shaped polyethylene frame with 380 mm2 of exposed surface consisting of fine copper wire wound around the vertical stem and each of the horizontal arms. There is a 3-mm ball at the base of the stem to decrease the risk of cervical perforation [1]. A white or clear polyethylene monofilament string is knotted through this ball.",
